import Men from "../Cloth/Men";
import Women from "../Cloth/Women";
import Electroni from "../Cloth/Electroni";
import Home from "../Cloth/Home";
import Jewelery from "../Cloth/Jewelery";
import axios from "axios";
import { useEffect, useState } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";

export default function App1(){
    const [product,setproduct]=useState([])
    useEffect(()=>{
        axios.get('https://fakestoreapi.com/products')
        .then(res=>setproduct(res.data))
    },[])
    return(
    <BrowserRouter><Nav />
        <Routes>
            
            <Route path={'/'} element={<Home product={product} />} />
            <Route path={'/Men'} element={<Men product={product} />} />
            <Route path={'/Women'} element={<Women product={product} />} />
            <Route path={'/Electronic'} element={<Electroni product={product} />} />
            <Route path={'/Jewelery'} element={<Jewelery product={product} />} />
        </Routes>
    </BrowserRouter>
    )
}
